import React from 'react'

function TransportChild(props) {
  return (
    <div>
      <h1>{props.data.name}</h1>
      <h1>{props.data.source}</h1>
      <h1>{props.data.destination}</h1>
      <h1>{props.data.price}</h1>
      <h1>{props.data.timeofTravel}</h1>
    </div>
  )
}

export default TransportChild
